Bodyguards and Assassins (2009)

China / Hongkong
Actie / Drama
138 minuten

geregisseerd door Teddy Chan
met Donnie Yen, Cung Le en Tony Leung Ka Fai

De film gaat over een groep experts op het gebied van vechtsport. Zij krijgen de taak Dr. Sun Yat-sen (een hoge Chinees), te beschermen, terwijl hij een bezoek brengt aan Hongkong. Hij is namelijk het doelwit van een moordaanslag.


